import React from 'react'

const Signup = () => {

    // Registration fields
    const [name, setName] = useState('');
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');
    const [password, setPassword] = useState('');

    // Submit
    const [submitted, setSubmitted] = useState(false);
    const [error, setError] = useState(false);

    return (
        <>
            <div className="container">
            <div className="col-md-4 my-5 offset-md-4">
            <form>
                <div className="mb-3">
                    <label htmlFor="name" className="form-label">Name</label>
                    <input type="name" className="form-control" id="name" value={name}/>
                </div>
                <div className="mb-3">
                    <label htmlFor="email" className="form-label">Email address</label>
                    <input type="email" className="form-control" id="email" value={email} aria-describedby="emailHelp"/>
                </div>
                <div className="mb-3">
                    <label htmlFor="phone" className="form-label">Phone</label>
                    <input type="text" className="form-control" id="phone" value={phone}/>
                </div>
                <div className="mb-3">
                    <label htmlFor="password" className="form-label">Password</label>
                    <input type="password" className="form-control" value={password} id="password"/>
                </div>
                <button type="submit" className="btn btn-primary">Submit</button>
            </form>
            
            </div>
        </div>
        </>
    )
}

export default Signup
